    return <h2>Loading...</h2>;
  }

  var count = 0;


  const ro={float:"right",
            display:"inline"}
  var count=0;



  return (
    <ul className='list-group mb-4'>
      {posts.map(post => (
      <>
        <li key={post.id} className='list-group-item'>
       <img  style={ro} height="200" width="200" src={post["Image url"]} alt="Beer Name" />
        {count=count+1}
      <div> <strong>classification_based_on:</strong>  {post.classification_based_on}</div>
         <div>humour: {post.humour}</div>
